import React from 'react'
import { Link } from 'react-router-dom';  

function DataInput({memos}) {
  return (
    <>
    <div className='bar'>
        <Link to='/memo'>
            <button className="w-btn w-btn-indigo" type="button">back</button>
        </Link>
        <button  className="w-btn w-btn-pink" type="button">Corret</button>
    </div>
        {memos.map((memo,index)=>{
              <div className='title' key={index}>
            <div className='title_name'>{memo.title}</div>
            <div className='content'>{memo.content}</div>
            </div>
        })}
</>
  )
}

export default DataInput
